import styles from "./Navbar.module.css";
import logo from "../icons/icon.png"
const Navbar = ( props ) => 
{
    /**
     * 
     * @param {Event} event 
     */
    const MouseEnterHandler = (event) => 
    {
        let wid = event.target.width();
        console.log(wid);
    }
    return(
    <nav className={`${styles["navbar"]}`}>
        <div>
        <img alt="qwenwq" src={logo} width="60" height="20">
        </img>
        </div>
        <div className={`${styles["rightNavbar"]}`}>
            <ul className={`${styles["menu"]}`}>
                <li onMouseEnter={MouseEnterHandler}>Home</li>
                <li onMouseEnter={MouseEnterHandler}>Services</li> 
                <li onMouseEnter={MouseEnterHandler}>About</li> 
                <li onMouseEnter={MouseEnterHandler}>Contact</li> 
            </ul>
        </div>
    </nav>
    );
}

export default Navbar;
